/*Table structure for table `hwt_admin` */

DROP TABLE IF EXISTS `hwt_admin`;

CREATE TABLE `hwt_admin` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `username` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '	用户名',
  `nickname` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '管理员名字',
