/*Table structure for table `hwt_auth_group` */

DROP TABLE IF EXISTS `hwt_auth_group`;

CREATE TABLE `hwt_auth_group` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '父ID',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '角色名称',
  `rules` text COLLATE utf8_unicode_ci NOT NULL COMMENT '规则ID(逗号分隔)',
  `remark` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '新增时间',
  `editime` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1-正常 2-不显示 3-已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='角色组表\r\n';

/*Data for the table `hwt_auth_group` */

