/*Table structure for table `hwt_auth_rule` */

DROP TABLE IF EXISTS `hwt_auth_rule`;

CREATE TABLE `hwt_auth_rule` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '父ID',
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '菜单名称',
  `url` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '菜单规则地址',
  `icon` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '图标',
  `condition` varchar(100) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '条件',
  `remark` varchar(200) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '备注',
  `ismenu` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1是，2不是',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT '权重',
  `addtime` int(11) NOT NULL DEFAULT '0' COMMENT '新增时间',
  `editime` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1-正常 2-不显示 3-已删除',
  PRIMARY KEY (`id`)
