/*Table structure for table `hwt_deal_user` */

DROP TABLE IF EXISTS `hwt_deal_user`;

CREATE TABLE `hwt_deal_user` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `type` tinyint(1) NOT NULL COMMENT '1-顶级分销商  2-普通分销商',
  `fcode` int(11) DEFAULT '0' COMMENT '父级code',
  `phone` varchar(50) NOT NULL COMMENT '会员手机号',
  `name` varchar(100) NOT NULL COMMENT '会员名称',
  `memcard` varchar(255) NOT NULL COMMENT '健康界后台memcard',
  `openID` varchar(255) DEFAULT NULL COMMENT 'openid',
  `nickname` varchar(255) DEFAULT NULL COMMENT '微信昵称',
  `avatarUrl` varchar(255) DEFAULT NULL COMMENT '微信头像',
  `status` tinyint(1) unsigned zerofill NOT NULL DEFAULT '1' COMMENT '状态 1-正常 2-禁用',
  `addtime` int(11) DEFAULT NULL COMMENT '添加时间',
  `editime` int(11) DEFAULT NULL COMMENT '编辑时间',
  `remark` text COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `only_memcard` (`memcard`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='会议分销商表';

